import {Container} from 'react-bootstrap';
import './registro.css';


const RegistroMainMenu = () => {
  return (
    <Container>
  <div className="login">
  <div className="login-triangle" />
  <h2 className="login-header">Registrate!</h2>
  <form className="login-container">
  <input className='mb-3' type="text" placeholder="UserName" />

      <input className='mb-3' type="text" placeholder="name" />
      <input className='mb-3' type="password" placeholder="Password" />
      <input type="submit" defaultValue="Log in" />
  </form>
</div>
  </Container>
  )
}

export default RegistroMainMenu
